import React, { useState, useEffect } from 'react';

const App = () => {
  const [playerPlane, setPlayerPlane] = useState({
    x: 400,
    y: 500,
    health: 100,
    ammo: 100,
  });

  const [enemies, setEnemies] = useState([]);
  const [bullets, setBullets] = useState([]);
  const [enemyBullets, setEnemyBullets] = useState([]);
  const [score, setScore] = useState(0);

  const handlePlayerMovement = (direction) => {
    const speed = 5; // Adjust player movement speed here

    if (direction === 'left') {
      setPlayerPlane((prevPlane) => ({ ...prevPlane, x: prevPlane.x - speed }));
    } else if (direction === 'right') {
      setPlayerPlane((prevPlane) => ({ ...prevPlane, x: prevPlane.x + speed }));
    }
  };

  const handlePlayerShoot = () => {
    if (playerPlane.ammo > 0) {
      const bullet = {
        x: playerPlane.x + 20,
        y: playerPlane.y,
        isPlayerBullet: true,
      };
      setBullets((prevBullets) => [...prevBullets, bullet]);
      setPlayerPlane((prevPlane) => ({ ...prevPlane, ammo: prevPlane.ammo - 1 }));
    }
  };

  const handleEnemyShoot = (enemy) => {
    const bullet = {
      x: enemy.x + 15,
      y: enemy.y + 30,
      isPlayerBullet: false,
    };
    setEnemyBullets((prevBullets) => [...prevBullets, bullet]);
  };

  const handleCollisionDetection = () => {
    // Check for player bullet-enemy collisions
    bullets.forEach((bullet, bulletIndex) => {
      if (bullet.isPlayerBullet) {
        enemies.forEach((enemy, enemyIndex) => {
          if (
            bullet.x < enemy.x + 30 &&
            bullet.x + 10 > enemy.x &&
            bullet.y < enemy.y + 30 &&
            bullet.y + 10 > enemy.y
          ) {
            setScore((prevScore) => prevScore + 1);
            bullets.splice(bulletIndex, 1);
            enemies.splice(enemyIndex, 1);
          }
        });
      }
    });

    // Check for enemy bullet-player collision
    enemyBullets.forEach((bullet, bulletIndex) => {
      if (!bullet.isPlayerBullet) {
        if (
          bullet.x < playerPlane.x + 50 &&
          bullet.x + 10 > playerPlane.x &&
          bullet.y < playerPlane.y + 50 &&
          bullet.y + 10 > playerPlane.y
        ) {
          setPlayerPlane((prevPlane) => ({ ...prevPlane, health: prevPlane.health - 10 }));
          enemyBullets.splice(bulletIndex, 1);
        }
      }
    });
  };

  const handleEnemyMovement = () => {
    setEnemies((prevEnemies) =>
      prevEnemies.map((enemy) => ({
        ...enemy,
        y: enemy.y + 2, // Adjust enemy movement speed here
      }))
    );
  };

  const handleEnemyBulletMovement = () => {
    setEnemyBullets((prevBullets) =>
      prevBullets.map((bullet) => ({
        ...bullet,
        y: bullet.y + 5, // Adjust the enemy bullet speed here
      }))
    );
  };

  const handleGameLoop = () => {
    handleEnemyMovement();
    handleEnemyBulletMovement();
    handleCollisionDetection();
  };

  useEffect(() => {
    const gameLoopInterval = setInterval(handleGameLoop, 16);

    return () => {
      clearInterval(gameLoopInterval);
    };
  }, []);

  return (
    <div className="game-container">
      <div className="game-screen">
        {/* Render player plane */}
        <div
          className="player-plane"
          style={{ left: playerPlane.x, top: playerPlane.y }}
        ></div>

        {/* Render enemies */}
        {enemies.map((enemy, index) => (
          <div
            key={index}
            className="enemy-plane"
            style={{ left: enemy.x, top: enemy.y }}
          ></div>
        ))}

        {/* Render player bullets */}
        {bullets.map((bullet, index) => (
          <div
            key={index}
            className="bullet"
            style={{ left: bullet.x, top: bullet.y }}
          ></div>
        ))}

        {/* Render enemy bullets */}
        {enemyBullets.map((bullet, index) => (
          <div
            key={index}
            className="enemy-bullet"
            style={{ left: bullet.x, top: bullet.y }}
          ></div>
        ))}
      </div>

      {/* Render player stats */}
      <div className="player-stats">
        <div>Health: {playerPlane.health}</div>
        <div>Ammo: {playerPlane.ammo}</div>
        <div>Score: {score}</div>
      </div>

      {/* Controls */}
      <div className="controls">
        <button onClick={() => handlePlayerMovement('left')}>Move Left</button>
        <button onClick={() => handlePlayerMovement('right')}>Move Right</button>
        <button onClick={handlePlayerShoot}>Shoot</button>
      </div>
    </div>
  );
};

export default App;
